import '../ChartSwiper.css'
function ChartSwiper(props){
    return(
        <div>
        <div className="rightSideCharts">
        <p>გამოშვება</p>
        <PieChart thirdDiagramValues1={props.thirdDiagramValues1} />

        </div>
        </div>
    )

}
export default ChartSwiper
